  <body>
    <script>
      function primes(start, end) {
        //Your code here
        const primes = [];
        for (let i = start; i <= end; i++) {
          primes.push(i);
        }
        primes.filter((prime) => {
          if (prime % 2 !== 0 && prime % 3 !== 0) {
            return prime;
          }
        });
      }
